package xyz.viseator.v2ex.data;/** * Created by viseator on 2016/11/24. */public class NodeInfo {    private int id;    private String name;    private String url;    private String title;    private String title_alternative;    private int topics;    private int stars;    private String header;    private String footer;    private long created;    private String avatar_mini;    private String avatar_normal;    private String avatar_large;    public String getTitle() {        return title;    }    public int getId() {        return id;    }    public String getName() {        return name;    }    public String getUrl() {        return url;    }    public String getTitle_alternative() {        return title_alternative;    }    public int getTopics() {        return topics;    }    public int getStars() {        return stars;    }    public String getHeader() {        return header;    }    public String getFooter() {        return footer;    }    public long getCreated() {        return created;    }    public String getAvatar_mini() {        return avatar_mini;    }    public String getAvatar_normal() {        return avatar_normal;    }    public String getAvatar_large() {        return avatar_large;    }}